import React from 'react'
import './App.css';

class ActiveUsers extends React.Component{

render() {
    return (
      <ul className = "ActiveUsers">
        <h4 > Friends who are online</h4>
        {this.props.onlineUsers.map(m => this.renderUsers(m))}
      </ul>
    );
  }

}

export default ActiveUsers
